    var result []*models.Event
    err := pipe.All(&amp;result)
    if err != nil {
        return nil, err
    }

    return result, nil
}
</code></pre>

<p>Looking at the Mongo documentation, I found that <strong>$project</strong> should help me doing what I want, but I did not find how to transform a nested document to the final document.</p>; Answer: `console.log` executed in callback?  You don't need to remove trailing slash manually.   `res.sendfile` should also use `path.join`.   Even better leave all this verboseness out, put all static files to `public` folder and use `app.use(express.static('public'))` to serve all static files in `public` folder.

