<pre class="lang-json prettyprint-override"><code>{
    "_id" : ObjectId("5b29ba37cd0b1726068731c3"),
    "name" : "Gym Dog",
    "profilePicUrl" : "https://i.imgur.com/mPStaKV.png",
    "totalProgress" : {
    "goal" : 300,
    "progress" : 0,
    "percentage" : 0
    },
    "goals" : [
    {
        "description" : "Running",
